import {IMAGES} from './theme/resource/HResource';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={IMAGES.appbackground} className="HBgColor" alt="logo" />
      </header>
    </div>
  );
}

export default App;
